import React from "react";
import { ProductInterface } from "./Interfaces/ProductInterface";

interface Props {
  product: ProductInterface;
}

const ProductComponent: React.FC<Props> = ({ product }) => {
  return (
    <div className="d-flex flex-row flex-m-row p-m-16px">
      <div className="position-relative">
        <img
          className="img-fluid"
          src={`https://static.my.ge/myauto/photos/${product.photo}/thumbs/${product.car_id}_1.jpg?v=${product.photo_ver}`}
          alt={product.car_model}
          style={{
            // position: "absolute",
            left: "-2.25%",
            right: "0%",
            top: "-2.14%",
            bottom: "-0.71%",
            borderRadius: "8px",
          }}
        />
      </div>
      <div className="model">{product.car_model}</div>
      <div className="year">{product.prod_year} წ</div>
      <div className="details">
        <p
          id="1"
          className="w-100 h-100 d-flex align-items-end"
          style={{
            fontFamily: "'TBC Sailec'",
            fontWeight: 500,
            fontSize: "12px",
            lineHeight: "12px",
            color: "#1B1D25",
          }}
        >
          motoriicon{product.engine_volume}
        </p>
        <p
          id="2"
          className="w-100 h-100 d-flex align-items-end"
          style={{
            fontFamily: "'TBC Sailec'",
            fontWeight: 500,
            fontSize: "12px",
            lineHeight: "12px",
            color: "#1B1D25",
          }}
        >
          garbeniicon{product.car_run_km} კმ
        </p>
        <p id="3">icon{product.gear_type_id} ₾</p>
        <p id="4">icon{product.right_wheel} $</p>
      </div>
      <div className="right-side">
        <div className="ganbajeba">{product.checked}</div>
        <div className="flagLoc">{product.location_id}</div>
        <p>{product.price} ლარიicon</p>
        <p>icons</p>
        <p>icons</p>
        <p>icons</p>
      </div>
      <div className="bottomLine">
        <p>vip</p>
        <p>{product.views} ნახვა .icon 2 დღის წინ</p>
      </div>
    </div>
  );
};

export default ProductComponent;
